    return (<>
            {
                projectData.map((item) => {
                    return(
                        <Project 
                           key = {item.id}
                           Name = {item.name}
                           Description ={item.description}
                           Skill = {item.skills}
                           Git = {item.github}
                        />
                    );
                }) 
            }  
         
    </>
    )
}
    return (
        <>
         
         <h1 className="text-primary">Projects</h1>  
